import React, { useState } from "react";
import { Link, useLocation } from "react-router-dom";
import { ReactComponent as SvgA } from './Asysmbol.svg';

function SideIcons(props) {
    const location = useLocation();
    if (props.type === "text") {
        const glow = {}
        if (("/" + props.name) == location.pathname) {
            const glow = { color: "var(--secondary-color)" }
        }
        return (
            <li className="navbar-item">
                <Link to={"/" + props.name}>
                    <a className="side-icons-text" style={{ glow }}>
                        {props.name}
                    </a>
                </Link>

            </li>
        );
    }
    else if (props.type === "head") {
        return (
            <Link to={"/"}>
                <SvgA className="navLogo" />
            </Link>

        );
    }
}

export default SideIcons;
